style.css:
@-moz-document domain("getonce.com") {
@font-face{font-family:Ubuntu;font-style:normal;font-weight:400;src:url(http://themes.googleusercontent.com/static/fonts/ubuntu/v4/2Q-AW1e_taO6pHwMXcXW5w.ttf) format(truetype);}
::-webkit-scrollbar{width:10px;height:10px;}
::-webkit-scrollbar-button{width:0;height:0;}
::-webkit-scrollbar-thumb{background:#e1e1e1;border:0 none #fff;border-radius:50px;}
::-webkit-scrollbar-track{background:#666;border:0 none #fff;border-radius:50px;}
::-webkit-scrollbar-track:hover{background:#666;}
::-webkit-scrollbar-corner{background:transparent;}
*{font-family:Ubuntu, sans-serif;}
.Navbar .nav__item__link:hover svg{fill:#49c1ab;}
.match{background:#000;color:#fff;}
.chat__content .sidebar.active{box-shadow:none;border-radius:0;}
.chat__content__block{background:#111;box-shadow:none;border-radius:0;}
.chat__content .header{background:#222;border-bottom:0;}
.chat__content .header .chat-action{border-left:0;}
.chat__block .reply-box{border-top:0;background:#222;}
.chat__content .disabled:before{background:rgba(34,34,34,0.5);}
.chat__block .reply-box__action__icons{border:0;}
.chat__block .reply-box__action__input{background:#000;border-radius:0;}
.chat__block .reply-box__action__input::placeholder{color:#999;}
.match-card{box-shadow:none;background:#222;border-radius:0;}
.dropdown.open .dropdown__menu{background:#333;box-shadow:none;}
.Navbar .nav__setting__profile.dropdown .dropdown__menu>a{color:#fff;border-bottom:1px solid #000;}
.oc-modal{background:#000;transition:9999s;}
.modal-complex{background:#222;color:#fff;box-shadow:none;}
.modal-complex>h2{background:#111;color:#fff;border-bottom:0;}
.oc-modal .crowns__plans__plan{border-top:1px solid #000;}
.crowns-payment__header{border-bottom:0;color:#fff;background:#333;}
.profile__header__location__choice>a:hover{color:#fff;background:#444;}
.profile__content__infos .info__value{text-align:left;}
.modal-container .modal-content .modal-box .once-modal>h2{background:#444;color:#49c1ab;border-bottom:0;}
.application-picture-uploader .picture-uploader-content .dragndrop{background:#111;border:5px dashed #349886;}
.modal-tuto .tuto-help .content .links a{background:#111;border:1px solid #000;color:#fff;}
.modal-tuto .tuto-help .content .links a:visited{background:#111;border:1px solid #000;}
::-webkit-scrollbar-thumb:hover,.slick-dots li button{background:#fff;}
::-webkit-scrollbar-thumb:active,.o-nav__item,.Navbar{background:#111;}
::-webkit-scrollbar-track:active,.responsive-footer,.oc-modal .crowns__plans__plan:hover,.oc-modal .crowns__plans__plan:nth-child(3),.modal-vip-plans .slick__item{background:#333;}
body,.Navbar .nav__item__link,.Navbar .nav__item__link:visited,.match__top-card h1,.match__top-card .countdown,.match-card,.match-card__info,.report-button__reasons>li a,.oc-modal__charm,.modal-complex .complex-settings .label--link a,.oc-modal .crowns__header h1,.oc-modal .crowns__header h4,.push-notif__notification__content p,.profile,.profile__content__description,.profile__header__location a,.profile__content__infos .info,.profile h2:focus .s-icon,.profile h2:hover .s-icon,.item__label,.once-select__dropdown__label span,textarea,.another__choice__info,.modal-vip-plans__footer p,.stalk-info__read-date--no-read,.stalk-info__read-date--read,.modal-vip a,.modal-tuto-premium .container p,.modal-tuto-premium .container pre{color:#fff;}
.Navbar .nav__item__link svg,.Navbar .nav__item__link:visited svg{fill:#349886;}
.Navbar .nav__item__link:hover,.push-notif__notification{background:#222;color:#fff;}
.match__top-card,.once-select__dropdown__menu,.modal-vip{box-shadow:none;background:#222;}
.button--primary,.button--danger,.button--primary:hover,.button--danger:hover,.button--primary:focus,.button--danger:focus,.picture-previewer:not(.small-gallery) .gallery-match .img-preview,.modal-premium,.button--warning:focus,.button--warning:hover,.button--warning,.match__brick__picture,.match__brick__container,.profile__content,.button--white,.button--white:hover,.button--white:focus,.button--vip,.button--vip:focus,.button--vip:hover,.modal-small,.button--success,.button--success:focus,.button--success:hover,.picture-previewer .gallery-profile .img-preview,.button,.button:hover,.button:focus,.modal-vip-plans .slick__overlay--pop,.modal-vip-plans .slick__overlay--pop .slick__overlay__footer,.rates__unrated__gallery>.pic{box-shadow:none;}
.application .application-container,.matches-buttons__bg,.once-select__dropdown__label{background:#000;}
.connections,.profile__content{background:#222;border-radius:0;}
.s-icon--color--blue,h1,h2,h3,h4,.payment label,.picture-previewer .gallery-profile .profile-previewer ul li:hover,.modal-vip a:active
.modal-vip a:focus,.modal-vip a:hover,.modal-tuto .tuto-pick__header h1,.pick__header h1,.pick__choices__choice .user__infos__header h2,.modal-tuto-premium .container h1,.modal-tuto-premium .container h2,.modal-container .modal-content .modal-box .close:hover,.modal-tuto .tuto-another__header h1,.another__content__header h1,.stalk-info__heading{color:#49c1ab;}
.chat .reply-box,.picture-previewer:not(.small-gallery) .gallery-match .img-preview li{border-radius:0;}
picture.picture,img.picture__item:after,.match__brick__container,.modal-premium,.matching-quality,.rates__unrated,.modal-small,.application-picture-uploader .picture-uploader-content .dragndrop:hover,.splash,.picture-previewer .gallery-profile .profile-previewer__delete{background:#222;}
.match-card__info:after,.profile__content__infos .info:after,.once-select__multi .item__label:after,.modal-complex .complex-description-editor textarea{background-color:#000;}
.Navbar .nav__setting__profile.dropdown .dropdown__menu>a:hover,.report-button__reasons>li a:hover,.once-select__dropdown__menu .item [type=checkbox]+.item__label:hover,.once-select__dropdown__menu .item [type=checkbox]:checked+.item__label,.modal-container .modal-content .modal-box .once-modal{background:#333;color:#fff;}
.modal-complex .complex-settings .subtitle,.oc-modal .crowns__plans__plan:last-child,.report-button__reasons>li{border-bottom:1px solid #000;}
.input.standard input,.picture-previewer .gallery-profile .profile-previewer ul li{background-color:#000;color:#fff;}
.oc-modal .crowns__plans__plan .plan-details h3,.modal-complex .complex-profile-editor{color:#349886;}
.application-picture-uploader .upload-mode.active,.modal-vip-plans .slick__item.slick-current .slick__item__content:before{background:#444;}
.modal-tuto,.pick__header,.pick__choices__choice .user,.modal-tuto-premium .container,.another__choice,.stalk-info__author{box-shadow:none;background:#222;color:#fff;}
.modal-tuto .tuto-help .content .links a:hover,.modal-tuto .tuto-help .content .links a:active{background:#333;border:1px solid #000;}
.connections .connections-chat__block__title{background:#111;}
.connections .connections-chat__block .connection:not(:last-child){border-bottom:#000;}
.connections .connections-chat__block .connection{background:#333;}
.connections .connections-chat__block .connection .connection-info .match-name{color:#49c1ab;}
.connections .connections-chat__block .connection .connection-info .msg, .connections .connections-chat__block .connection .connection-info__last-msg{color:#fff;}
.connections .connections-chat__block .connection--unread, .connections .connections-chat__block .connection:focus, .connections .connections-chat__block .connection:hover{background:#444;}
.chat-message .msg-body{box-shadow:none;background:#222;color:#fff;}
.chat-message--sender .msg-body{background-color:#000;}
.oc-modal .small-another-now{color:#fff;}

.text-divider{color:#fff;}
.block-button__label:focus, .block-button__label:hover,.block-button__content>a:focus, .block-button__content>a:hover{background:#444;}
a{color:#349886;}
a:active, a:focus, a:hover{color:#49c1ab;}
.s-icon--color--primary{color:#3085D6;}
.modal-complex .complex-settings hr{background:#000;}
.button--vip,.button--vip:visited,.button--vip:focus,.button--vip:hover{color:#644429;font-weight:bold;}
.button--warning,.button--warning:visited,.button--warning:focus,.button--warning:hover{color:#644429;font-weight:bold;}
.simple-notification.error .msg div{background-color:#CA3838;color:#fff;border-color:#CA3838;border-radius:0px;font-weight:bold;text-transform:uppercase;line-height:20px;}
.button--white{background:#000;}
.button--white:hover,.button--white:visited,.button--white:active,.button--white:focus{background:#111;}

.chat-requests__button{background:#111;}
.chat-requests__preview h1, .chat-requests__preview h2, .chat-requests__preview h3{color:#fff;}

.button--success,.button--success:visited,.button--success:focus,.button--success:hover{color:#30583A;font-weight:bold;}
.premium-buttons button{color:#386F46;}
